SET NOCOUNT ON
GO

USE master
GO

if exists (select * from sysdatabases where name='ParkwayCommute')
	alter database ParkwayCommute set single_user with rollback immediate
	drop database ParkwayCommute
GO

DECLARE @device_directory NVARCHAR(520)
SELECT @device_directory = SUBSTRING(filename, 1, CHARINDEX(N'master.mdf', LOWER(filename)) - 1)
FROM master.dbo.sysaltfiles WHERE dbid = 1 AND fileid = 1

EXECUTE (N'CREATE DATABASE ParkwayCommute
  ON PRIMARY (NAME = N''ParkwayCommute'', FILENAME = N''' + @device_directory + N'parkway.mdf'')
  LOG ON (NAME = N''ParkwayCommute_log'',  FILENAME = N''' + @device_directory + N'parkway.ldf'')')
GO

set quoted_identifier on
GO

/* Set DATEFORMAT so that the date strings are interpreted correctly regardless of
   the default DATEFORMAT on the server.
*/
SET DATEFORMAT mdy
GO
use "ParkwayCommute"
GO

if exists (select * from sysobjects where id = object_id('dbo.Employees') and sysstat & 0xf = 3)
	drop table "dbo"."Employees"
GO

if exists (select * from sysobjects where id = object_id('dbo.Commutes') and sysstat & 0xf = 3)
	drop table "dbo"."Commutes"
GO

if exists (select * from sysobjects where id = object_id('dbo.TravelModes') and sysstat & 0xf = 3)
	drop table "dbo"."TravelModes"
GO

CREATE TABLE "Employees" (
	"EmployeeID" "int" IDENTITY (1, 1) NOT NULL , 
	"FirstName" nvarchar (20) NOT NULL , 
	"LastName" nvarchar (20) NOT NULL ,
	"Role" nvarchar (30) NULL ,
	"HomeAddr" nvarchar (60) NULL ,
	"HomeCity" nvarchar (60) NULL ,
	"WorkAddr" nvarchar (60) NULL ,
	"WorkCity" nvarchar (60) NULL ,
	CONSTRAINT "PK_Employees" PRIMARY KEY CLUSTERED (
		"EmployeeID"
	)
)
GO

CREATE TABLE "Commutes" (
	"CommuteID" "int" IDENTITY (1, 1) NOT NULL ,
	"ArriveBy" "datetime" NOT NULL ,
	"ArriveTime" "int" NOT NULL , 
	"DepartBy" "datetime" NOT NULL ,
	"DepartTime" "int" NOT NULL ,
	"Employee" "int" NOT NULL ,
	CONSTRAINT "PK_Commutes" PRIMARY KEY CLUSTERED ( "CommuteID" ) ,
	CONSTRAINT "FK_Employees_Commutes" FOREIGN KEY ( 
		"Employee"
	) REFERENCES "dbo"."Employees" (
		"EmployeeID"
	)
)
GO

CREATE TABLE "TravelModes" (
	"ModeID" "int" IDENTITY (1, 1) NOT NULL ,
	"TravelMode" nvarchar (20) NOT NULL CHECK ("TravelMode" IN('Car', 'Carpool', 'Bike', 'Bus', 'Walk')) ,
	"EmissionsType" nvarchar (20) NOT NULL CHECK ("EmissionsType" IN('Petrol', 'Diesel', 'Electric', 'Hybrid', 'None', 'Unknown')) , 
	"Employee" "int" NOT NULL ,
	CONSTRAINT "PK_TravelModes" PRIMARY KEY CLUSTERED ( "ModeID" ) ,
	CONSTRAINT "FK_Employees_Modes" FOREIGN KEY (
		"Employee"
	) REFERENCES "dbo"."Employees" (
		"EmployeeID"
	)
)
GO

